window.bookSummaryJSON = "<p><b>The heart-pounding conclusion of the Deliver series. </b></p> <p>Cole Hartman is a mystery. He works alone, sleeps alone, and satisfies his aches...alone. He hasn't touched a woman in seven years. No one will ever compare to the one who broke his heart. Until he stares into the seductive eyes of his enemy. </p> <p>He finally meets his match in the redheaded Russian spy. But she's a dangerous risk. His obsession with her leaves him only one choice. If you love something, let it go. If it doesn't kill you, hunt it down and take it.</p>"; 
